import "../css/element/loading.css";
export const LoadingElement = ({ text }) => (
  <section className="loading">
    {LoadingContent}
    <h1 className="loading__text"> {text}</h1>
  </section>
);

const LoadingContent = (
  <ReactLoading
    type={"spinningBubbles"}
    className="loading-bar"
    height={"5vh"}
    // width={"15%"}
    color={"#663333"}
  ></ReactLoading>
);
